ModAPI.meta.title("Better loading screen");
ModAPI.meta.credits("By Oeildelynx31");
ModAPI.meta.description("This mod adds a cool loading screen, as Forge or Fabric.");
ModAPI.meta.version("1.0.0");
ModAPI.meta.icon("data:image/png;base64,");

const style = document.createElement('style');
Minecraft.$gameSettings.$enableUpdateSvc = 0;
style.innerHTML = `
    #loaderDiv {
        background-color: #ef323d;
        color: white;
        position: absolute;
        top: 0px;
        left: 0px;
        height: 100%;
        width: 100%;
        z-index: 10000;
        opacity: 100;
        transition: 2s .25s ease;
        display: flex;
        justify-content: center;
        flex-direction: column;
        align-items: center;
    }
    
    #anvil {
        position: absolute;
        right: 1%;
        bottom: 2%;
        height: 30%;
        transition: .5s ease;
    }

    #versions {
        font-family: Minecraftia;
        color: white;
        position: absolute;
        top: 0.5rem;
        left: 2rem;
        font-size: 1.5rem;
        user-select: none;
        transition: .5s ease;
    }

    #loadingText {
        font-family: Minecraftia;
        color: #ffffff99;
        position: absolute;
        bottom: 1rem;
        left: 2rem;
        font-size: 1.2rem; 
        width: 70%;
        user-select: none;
        transition: .5s ease;
        overflow-x: clip;
    }

    #majong {
        width: 65%;
        image-rendering: pixelated;
        margin-bottom: 2rem;
        transition: .5s ease;
    }

    #loadingBar {
        height: 2rem;
        width: 50%;
        border: 0.25rem solid #fff;
        padding: 0.25rem;
        box-sizing: border-box;
        margin-bottom: 1rem;
        transition: .5s ease;
    }

    #loadingBarProgress {
        box-sizing: border-box;
        border: none;
        height: 1rem;
        background-color: #fff;
        width: 0%;
        transition: 1s ease;
    }

    #progressText {
        font-family: Minecraftia;
        color: white;
        font-size: 2rem;
        user-select: none;
        transition: .5s ease;
    }
    
    @font-face { font-family: Minecraftia; src: url(data:font/truetype;base64,); }
    `;
document.head.appendChild(style);
loaderDiv = document.createElement('div');
loaderDiv.id = 'loaderDiv';


let anvil = document.createElement('img');
anvil.src = 'data:image/gif;base64,';
anvil.id = "anvil";

let majong = document.createElement('img');
majong.src = 'data:image/png;base64,';
majong.id = "majong";

let versions = document.createElement('span');
versions.id = 'versions';
let efi = ModAPI.version;
let mc = ModAPI.util.ustr(Minecraft.$getVersion());
let egc = ModAPI.util.ustr(ModAPI.hooks._classMap.nlev_EaglercraftVersion.staticVariables.mainMenuStringB).replace('1.8-', '').replace(' ultimate [JS]', '');
versions.innerText = `Minecraft ${mc} - ${egc}\nEaglerforge ${efi}`;

let loadingText = document.createElement('span');
loadingText.id = "loadingText";

let loadingBar = document.createElement('div');
loadingBar.id = "loadingBar";

let loadingBarProgress = document.createElement('div');
loadingBarProgress.id = "loadingBarProgress";

loadingBar.appendChild(loadingBarProgress);
let progressStep = 0;

let progressText = document.createElement('span');
progressText.id = "progressText";
progressText.innerText = "Starting Minecraft";

loaderDiv.appendChild(versions);
loaderDiv.appendChild(loadingText);
loaderDiv.appendChild(majong);
loaderDiv.appendChild(loadingBar);
loaderDiv.appendChild(progressText);
loaderDiv.appendChild(anvil);
document.body.appendChild(loaderDiv);

let oldFunction = console.info;
console.info = function (...args) {
    setLoadingText(args);
    return  oldFunction.apply(this, args)
}

let previousStep = null;

function setLoadingText(text) {
    loadingText.innerText = ''.concat(text).replaceAll(',', '').replaceAll('][', '] [').replaceAll(']:', ']:\n');
    if (''.concat(text).indexOf('does not exist, cannot add it') > -1) {
        progressText.innerText = "Loading mods";
        progressStep = 4;
    } else if (''.concat(text).indexOf('Checking if mods are finished') > -1) {
        progressText.innerText = "Loading connected textures";
        progressStep = 8;
    } else if (''.concat(text).indexOf('ConnectedTextures') > -1) {
        progressText.innerText = "Reloading custom textures";
        progressStep = 9;
    } else if (''.concat(text).indexOf('Reloading custom textures') > -1) {
        progressText.innerText = "Loading done";
        console.info = oldFunction;
        progressStep = 10;
        setTimeout(function() {
            Minecraft.$displayGuiScreen(Minecraft.$currentScreen.$parent0);
            loaderDiv.style.opacity = "0";
            loaderDiv.style.pointerEvents = "none";
            progressText.style.opacity = 0;
            loadingBar.style.opacity = 0;
            majong.style.opacity = 0;
            anvil.style.opacity = 0;
            versions.style.opacity = 0;
            loadingText.style.opacity = 0;
        }, 1000);
        setTimeout(function() {
            loaderDiv.style.display = "none";
        }, 3500);
    }
    if (previousStep < progressStep) {
        loadingBarProgress.style.width = `calc(100% / 10 * ${progressStep})`;
        previousStep = progressStep;
    }
}